import React from 'react';

const DashboardContent = () => {
  return (
    <main className="flex-1 p-6">
      <div className="container mx-auto">
        <h2 className="text-2xl font-semibold mb-6">Dashboard Content</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          <div className="bg-white p-4 shadow rounded-lg">
            <h3 className="text-lg font-semibold mb-2">Card 1</h3>
            <p>Content for the first card goes here.</p>
          </div>
          <div className="bg-white p-4 shadow rounded-lg">
            <h3 className="text-lg font-semibold mb-2">Card 2</h3>
            <p>Content for the second card goes here.</p>
          </div>
          <div className="bg-white p-4 shadow rounded-lg">
            <h3 className="text-lg font-semibold mb-2">Card 3</h3>
            <p>Content for the third card goes here.</p>
          </div>
        </div>
      </div>
    </main>
  );
};

export default DashboardContent;
